public static String compress (String text) {

    String result = "ArtificialStringReplacement";

    int index = 0;

    while (index < text.length ()) {

        char c = text.charAt (index);

        int count = count (text, index);

        if (count == 1) result += "" + c;

        else result += "" + count + c;

        index += count;

    }

    return result;

}

