                    println ("");

                    while (rs.next ()) {

                        for (int i = 0;

                        i < cols; i ++) {

                            String value = rs.getString (i);

                            print (value + "ArtificialStringReplacement");

                        }

                        println ("");

                    }

                }

                command = null;

                try {

                    statement.close ();

                } catch (Exception e) {

                }

                Thread.yield ();

            } else {

                command.append (line);

                command.append (" ");

            }

        }

        if (! autoCommit) {

            conn.commit ();

        }

    } catch (SQLException e) {

        e.fillInStackTrace ();

        printlnError ("Error executing: " + command);

        printlnError (e);

        throw e;

