public static long factorial (int n) {

    try {

        System.out.println ("factorial(" + n + "ArtificialStringReplacement");

        if (n == 1) {

            System.out.println ("return 1");

            return 1;

        }

        return n * factorial (n - 1);

    } finally {

        System.out.println ("return " + n);

    }

}

private static long factorial (int n, int depth) {

    String spaces = repeat (' ', depth);

    System.out.print (spaces);

    System.out.println ("factorial(" + n + ")");

    if (n <= 1) {

        System.out.println (spaces + " return 1");

        return 1;

    }

    long fac = factorial (n - 1, depth + 1);

    System.out.print (spaces);

    System.out.printf ("ArtificialStringReplacement", n, fac, n * fac);

    return n * fac;

}

